import React from 'react';

import {SpinnerOverlay, SpinnerContainer} from './spinner.styles';

const WithSpinner = Wrapped => ({isLoading, ...otherProps}) => {
    return isLoading ? (
        <SpinnerOverlay>
            <SpinnerContainer/>
        </SpinnerOverlay>
    ) : (
        <Wrapped {...otherProps} />
       )
}

export default WithSpinner;
